import React from 'react'
import { Link } from 'react-router-dom';
import {
    Navbar,
    Nav,
    NavItem,
    NavbarBrand,
    Container
} from 'reactstrap';

export const Heading = () => {
    return (
        <Navbar>
            <Container>
                <NavbarBrand  href="/">
                    My Team
                </NavbarBrand>
                <Nav>
                    <NavItem>
                        <Link className="btn btn-primary"
                          to="/add">Add User</Link>
                    </NavItem>

                </Nav>
            </Container>
        </Navbar>
    )
}
